import React from 'react';
import CustomSelections from '../CustomSelections/CustomSelections';

class CustomOptionsBox extends React.Component {
    render() {
        console.log(this.props);
        return (
            <div>
                <p>CustomOptionsBox</p>
                <CustomSelections selectedFeatures={this.props.selectedFeatures} featuresAvailable={this.props.featuresAvailable} />
                <fieldset className="feature" key={'featureHash'}>
                    <legend className="feature__name">
                        <h3>{'feature'}</h3>
                    </legend>
                    {'options'}
                </fieldset>
            </div >
        );
    }
}

export default CustomOptionsBox;
